var tipuesearch = {"pages": [{'title': 'weeks', 'text': '', 'tags': '', 'url': 'weeks.html'}, {'title': 'week2~5', 'text': '先建立github倉儲，在clone到自己的隨身系統 \n 1.加入擊建立課程倉儲(cad2019)到近端上 \n 2.用git submodule add之指令 \n 3.要快速開啟近端時只要進入cmsimde，就能夠開啟python\xa0 \n 4.開啟python，就可以開啟自己網站進行修改 \n 5.修改完就可以commite push 即完成 \n \n week3 \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n 1.先將 Y:\\portablegit\\bin\\sh.exe 改名為 sh_rename_for_solvespace.exe \n 2. \xa0打指令git clone\xa0 --recurse-submodules \n 3.到untitle編輯cmakelist內之 713 及 714 行(加入#字號) \n 4.進入資料夾 cd solvespace>cd extlib>cd libpng>mkdir build>cd build \n 5.執行 cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release mingw32-make \n 6.找到檔案 \xa0libpng.dll.a  更名, 更名名為  libpng_static.a \n 7.回到 solvespace 目錄,建立 build 目錄後進入 build 資料夾 \n 8.在執行指令cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release mingw32-make \n \n week4 \n \n \n \n \n \n 1.對網站做更新 \n 2.上傳影片 \n 3.我是用shareX來錄影 \n 4.運用acttime來上字幕 \n week5 \n 練習solvespace基本操作 \n 在一個正方形上學會定點，讓其保持水平垂直，且在其中三面作圖 \n 主要重點: \n (1)繪製正方形，並幫其定尺寸 \n (2)把正方形換成正方體，並定其厚度 \n (3)在正方體上，選取一點兩線，設置新的NEW GROUP \n (4)在新的繪圖面定中心點(指令 M ) \n (5)在繪製圓形，再將以設好的點打指令 H 及 V 訂好水平及垂直 \n \n', 'tags': '', 'url': 'week2~5.html'}, {'title': 'week6~9', 'text': '(1)下載 \xa0 V-rep 3.6.1 rev 4.7z \xa0及 web_vrep2.zip \xa0( local ) 並解壓縮到隨身碟 \n (2)打開 web_vrep2 裡的 app.py 並執行，進入到 http://127.0.0.1:5000/ \n (3)打開vrep.exe並開啟web_vrep2裡的two_wheeler.ttt車子檔案 \n (4)按開始之後，就可以利用運用控制器的前後左右測試是否可以控制車子 \n 任務一網際 V-rep 模型控制 \n \n W6 任務一參數化零組件繪製 \n 自己畫車子 \n \n (1)先繪製車身， 並且輸入其安裝輪軸時的長度及車身的長度 \n (2)在加上輪胎， 繪製一圓圈(使用指令 c )作為輪胎，加上尺寸，訂好圓心就行 \n (3)加上車子擋板，直接在正面設一個NEW Group 在繪製兩個長方形在長出即可 \n 成品圖: \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'week6~9.html'}, {'title': 'week10~14', 'text': '', 'tags': '', 'url': 'week10~14.html'}, {'title': 'note', 'text': 'solvespace會使用到的快捷鍵 \n 以下快捷鍵: \n equal length/radius/angle \xa0 (Q) \n split line\xa0 (I) \n sketch line segment\xa0 (S) \n constrain distance\xa0 (D) \n sketch rectangle\xa0 (R) \n nearest isometric view\xa0 (F3)\xa0 \n sketch circle \xa0(C) \n align view to workplane\xa0 (W)\xa0 \n constrain angle\xa0(N) \n extrude \xa0(shift+X) \n 比較 常使用 的快捷鍵: \n tangent arc\xa0 (shift+A) \n benchmark\xa0 (P) \n sketh arc of a circle\xa0 (A) \n sketh cubic bezier spline\xa0 (B) \n verticel \xa0(V) \n horizontal\xa0 (H) \n two line symmetry\xa0 (Y) \n two line\xa0parallel\xa0 (L) \n two line perpencudilar \xa0([) \n same direction\xa0 (X) \n benchmark\xa0 (P) \n 翻譯版 \n 等長/半徑/角度（Q） \n 分割線（I） \n 草圖線段（S） \n 約束距離（D） \n 草圖矩形（R） \n 最近的等軸測圖（F3） \n 素描圈（C） \n 將視圖與工作平面對齊（W） \n 約束角（N） \n 擠出（Shift + X） \n 比較常使用的快捷鍵： \n 切線弧度（shift + A） \n 基準（P） \n 圓的圓弧（A） \n sketh三次貝塞爾曲線樣條（B） \n 垂直（V） \n 水平（H） \n 兩線對稱（Y） \n 兩線平行（L） \n 兩線垂直（[] \n 相同方向（X） \n 基準（P）', 'tags': '', 'url': 'note.html'}, {'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'Develop.html'}]};